import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ProductInfo.css';

const ProductInfo = () => {
    const [products, setProducts] = useState({ agroChemical: [], organic: [], inorganic: [] });
    const [activeProduct, setActiveProduct] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const [agroChemicalResponse, organicResponse, inorganicResponse] = await Promise.allSettled([
                    axios.get('https://api.shreejiinternationals.in/products/agrochemical'),
                    axios.get('https://api.shreejiinternationals.in/products/organic'),
                    axios.get('https://api.shreejiinternationals.in/products/inorganic')
                ]);

                const agroChemicalData = agroChemicalResponse.status === 'fulfilled' && Array.isArray(agroChemicalResponse.value.data) ? agroChemicalResponse.value.data : [];
                const organicData = organicResponse.status === 'fulfilled' && Array.isArray(organicResponse.value.data) ? organicResponse.value.data : [];
                const inorganicData = inorganicResponse.status === 'fulfilled' && Array.isArray(inorganicResponse.value.data) ? inorganicResponse.value.data : [];

                setProducts({
                    agroChemical: agroChemicalData,
                    organic: organicData,
                    inorganic: inorganicData,
                });
            } catch (error) {
                setError('Error fetching products. Please try again later.');
                console.error('Error fetching products:', error);
            }
        };

        fetchProducts();
    }, []);

    const toggleProductInfo = (_id) => {
        setActiveProduct(activeProduct === _id ? null : _id);
    };

    const renderProducts = (category) => {
        const categoryProducts = products[category];
        if (!Array.isArray(categoryProducts) || categoryProducts.length === 0) {
            return <p>No products available</p>;
        }
        return categoryProducts.map((product) => (
            <div className="product-container" key={product._id}>
                <div
                    className={`product-item ${activeProduct === product._id ? 'expanded' : ''}`}
                >
                    <div
                        className="product-title"
                        onClick={() => toggleProductInfo(product._id)}
                    >
                        {product.ame}
                    </div>
                    {activeProduct === product._id && (
                        <div className="product-info">
                            <table>
                                <tbody>
                                    <tr>
                                        <th>Technical Name</th>
                                        <td>{product.TechnicalName || 'N/A'}</td>
                                    </tr>
                                    <tr>
                                        <th>CAS No.</th>
                                        <td>{product.CASno || 'N/A'}</td>
                                    </tr>
                                    <tr>
                                        <th>Chemical Structure</th>
                                        <td>
                                            <img src={product.ChemicalStructure || 'default-image-url'} alt="Chemical Structure" />
                                        </td>
                                    </tr>
                                    <tr>
                                        <th>Packing</th>
                                        <td>{product.Packing || 'N/A'}</td>
                                    </tr>
                                </tbody>
                            </table>
                        </div>
                    )}
                </div>
            </div>
        ));
    };

    return (
        <div className="product-info-container">
            {error && <div className="error-message">{error}</div>}
            <header className="product-header">
                <div className="cover-image">
                    <div className="cover-text">
                        <h1>Our Products</h1>
                        <p>Quality Products for Quality Produce</p>
                    </div>
                </div>
            </header>
            <div className="product-section">
                <h2>Agrochemicals</h2>
                <div className="product-list">
                    {renderProducts('agroChemical')}
                </div>
            </div>
            <div className="product-section">
                <h2>Organic</h2>
                <div className="product-list">
                    {renderProducts('organic')}
                </div>
            </div>
            <div className="product-section">
                <h2>Inorganic</h2>
                <div className="product-list">
                    {renderProducts('inorganic')}
                </div>
            </div>
        </div>
    );
};

export default ProductInfo;
